const Tasks = () => {
const [tasks, setTasks] = useState([
  {
    id: 1,
    text: 'Doctors Appointment',
    day: 'August 10th @ 2:45pm',
    reminder: true,
  },
  {
    id: 2,
    text: 'Meeting',
    day: 'August 15th @ 6:00pm',
    reminder: true,
  },
  {
    id: 3,
    text: 'Gym Training',
    day: 'August 12th @ 1:30pm',
    reminder: false,
  },
  ])

  return (
    <div>
      {tasks.map((task) => (<h2 className="task h2" key={task.id}>{task.text}</h2>))}
    </div>
  )
}

export default Tasks;
